var extra_content_emoticons = {

    /* emoticons fuction */

    emoticons: function () {
        var cList = jQuery('.ex-content__emoticons-list');
        emoticons.map( (item,i) => {
            var li = jQuery('<li/>')
                .addClass('ex-content__emoticons-list_item')
                .attr('role', 'menuitem')
                .appendTo(cList);
            jQuery('<span class="ex-content__emoticons-list__img" title="'+item.name+'"><img src="https://cdnjs.cloudflare.com/ajax/libs/emojione/2.0.1/assets/png/'+ item.unicode.toLowerCase() + '.png" /></span>')
                .appendTo(li);
        });
    },

    /* icons fuction */
    icons: function () {
        var cList = jQuery('.ex-content__icons-list');
        IconsList.map( (item,i) => {
            var li = jQuery('<li/>')
                .addClass('ex-content__icons-list_item')
                .attr('role', 'menuitem')
                .appendTo(cList);
            jQuery('<span class="ex-content__icons-list__img" title="'+item+'"><i class="fa '+item+'"></span>')
                .appendTo(li);
        });
    },


    /*
      ** init Function
    **/

    init: function() {
        extra_content_emoticons.emoticons();
        extra_content_emoticons.icons();
    },
};

jQuery(window).on("load", function() {
    extra_content_emoticons.init();
});